angular.module('managerApp').run(["$q", "$translate", "Toast", "SidebarMenu", "SidebarOrderService", "SidebarContentService", "ProductsService", "SessionService", function ($q, $translate, Toast, SidebarMenu, SidebarOrderService, SidebarContentService, ProductsService, SessionService) {
  var promise = $q.all({
    user: SessionService.getUser(),
    products: ProductsService.getProducts(),
    translate: $translate.refresh()
  }).catch(function (err) {
    Toast.error("".concat($translate.instant('cloud_sidebar_error'), " ").concat(err.data.message));
  });
  SidebarMenu.setInitializationPromise(promise);
  SidebarMenu.loadDeferred.promise.then(function (data) {
    SidebarOrderService.buildSidebarMenuActions(data.user.ovhSubsidiary);
    return SidebarContentService.buildSidebarContent(data.products.results, data.user.ovhSubsidiary);
  }).then(function () {
    // After sidebar elements are all loaded, check if there is an element for the current state
    SidebarMenu.manageStateChange();
  });
}]);
